import React from 'react';

import ButtonComponent from '../public/ButtonComponent';

class RequestHistory extends React.Component {

  render() {
    console.log(JSON.parse(localStorage.getItem('userData')).id)
    return (
      <div>
        <h1>依頼履歴</h1>
        <ButtonComponent
          link = {`/history/requests/${this.props.match.params.requestId}`}
          buttonText = "依頼履歴"
        />
        <ButtonComponent
          link = {`/history/proposals/${this.props.match.params.requestId}`}
          buttonText = "提案履歴"
        />
      </div>
    );
  }
}

export default RequestHistory;
